import React from 'react'
import { useHistory } from "react-router-dom";
import {useAuth} from '../App/AppContext'

export const LoginPage = () => {
  let history = useHistory();
  let auth = useAuth();

  let login = () => {
    auth.signin(() => {
      history.push('/protected');
    })
  }

  return (
    <div>
      <input />
      <input />
      <button onClick={login}>Log in</button>
    </div>
  )
}
